import React from "react";
import {foods} from "../data/foods";
import {captions} from "../data/captions";
import "./Foods.scss"

const Foods = () => {

    return (
        <div>
            <div className="food">
                {foods.map(food => <img className="foodpic" src={food}/>)}
                {captions.map(caption => <p className="caption">{caption}</p>)}
            </div>
        </div>
    )
}

export default Foods
